import { Layout, Menu, Breadcrumb, Row, Col } from "antd";

const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

const Profile = () => {
  return (
    <div className="profile">
      <Layout>
        <Sider>
          <div>
            <Row>
                <Col>
                </Col>
            </Row>
          </div>
        </Sider>
        <Content
          className="site-layout-background"
        >
          Content
        </Content>
      </Layout>
    </div>
  );
};

export default Profile;
